import React, { FC, useState } from 'react'
import { INote } from '../types'
import List from './List'

interface NoteProps {
  note: INote
}

const Note: FC<NoteProps> = ({ note }) => {
  const [children, setChildren] = useState<INote[]>(note.childrens)

  const setChildrenHandler = () => {
    setChildren({ ...children })
  }

  return (
    <li onClick={() => console.log(children)}>
      {note.title}
      <List
        items={children}
        renderItem={(note: INote) => <Note key={note._id} note={note} />}
      />
    </li>
  )
}

export default Note
